        tabletmp = `<table id = "data"><tr><th width="75px">類別</th><th>${data[check]["類別"]}</th></tr><tr><td width="75px">故障代碼</td><td >${data[check]["故障代碼"]}</td></tr><tr><td width="75px">中文定義</td><td>${data[check]["中文定義"]}</td></tr><tr><td width="75px">故障位置</td><td>${data[check]["故障位置"]}</td></tr><tr><td width="75px">故障說明</td><td width="350px">${data[check]["故障說明"]}</td></tr></table>`
